import logo from './logo.svg';
import './App.css';
import SignUp from "./components/SignUp"
import Login from "./components/Login"
import Home from "./components/Home.jsx"
import Contact from "./components/Contact"
import AboutUs from "./components/AboutUs"
import Courses from "./components/Courses"
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import { LoginValueContext } from './global/Loginvalue';
import { useState } from 'react';

function App() {

  const [loggedInValue, setLoggedInValue] = useState(false)
  return (

    <LoginValueContext.Provider value = {{loggedInValue, setLoggedInValue}}>
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Home />}></Route>
        if(loggedInValue == true){
             <Route path="/login" element={<Login />}>
             <Route path='courses' element={<Courses />}></Route>
            </Route>
        }
        else{

        }

        <Route path="/signup" element={<SignUp />}>
          <Route path='courses' element={<Courses />}></Route>
        </Route>
        <Route path='/home' element={<Home />}></Route>
        <Route path='/contact' element={<Contact />}></Route>
        <Route path='/aboutus' element={<AboutUs />}></Route>

      </Routes>
    </BrowserRouter>
    </LoginValueContext.Provider>
  );
}

export default App;
